import * as React from "react";
import ReactMapGL, { Source, Layer } from "react-map-gl";
const TOKEN =
	"pk.eyJ1IjoiYXJpc2FyZXMyMiIsImEiOiJja21hNHN4bncxbzN1Mm5wcnZqZmhmd245In0.mo6lAUdwinLZchtCADFthw";

const geojson = {
	routes: [
		{
			weight_name: "auto",
			weight: 582.336,
			duration: 391.157,
			distance: 1520.571,
			legs: [
				{
					admins: [
						{
							iso_3166_1_alpha3: "USA",
							iso_3166_1: "US",
						},
					],
					weight: 582.336,
					duration: 391.157,
					steps: [],
					distance: 1520.571,
					summary: "East 8th Street, 4th Avenue",
				},
			],
			geometry: {
				coordinates: [
					[-73.995943, 40.732081],
					[-73.991088, 40.730053],
					[-73.99041, 40.731002],
					[-73.98983, 40.733689],
					[-73.989944, 40.735102],
					[-73.988942, 40.736525],
					[-73.989062, 40.736576],
					[-73.990023, 40.735317],
					[-73.990717, 40.73478],
					[-73.991055, 40.734928],
				],
				type: "LineString",
			},
		},
	],
	waypoints: [
		{
			distance: 10.224,
			name: "East 8th Street",
			location: [-73.995943, 40.732081],
		},
		{
			distance: 9.265,
			name: "East 14th Street",
			location: [-73.991055, 40.734928],
		},
	],
	code: "Ok",
	uuid: "FZegNYCJe76aasfS28PC7dOMIkqPf108_VCR9Os28fUtzEOk-SO7Sw==",
};

const layerStyle = {
	id: "point",
	type: "circle",
	paint: {
		"circle-radius": 10,
		"circle-color": "#007cbf",
	},
};

function App() {
	const [viewport, setViewport] = React.useState({
		longitude: -73.991055,
		latitude: 40.734928,
		zoom: 14,
	});
	return (
		<ReactMapGL
			{...viewport}
			width="100vw"
			height="100vh"
			onViewportChange={setViewport}
			mapboxApiAccessToken={TOKEN}
		>
			<Source id="my-data" type="geojson" data={geojson}>
				<Layer {...layerStyle} />
			</Source>
		</ReactMapGL>
	);
}

export default App;
